import './buttons.css'
type AddButtonProps = {
  handleEqualButtonClick: () => void;
};
function EqualButton({handleEqualButtonClick}: AddButtonProps) {
  return (
    <div>
       <button onClick={handleEqualButtonClick} className='equal'>=</button>
    </div>
  )
}

export default EqualButton
